import React from 'react';
import '../'; // Import custom CSS file for ContactUs styles

const ContactUs = () => {
  return (
    <div className="contact__container">
      {/* Content on the left side for large devices */}
      <div className="contact__content">
        <h2>Contact Us</h2>
        <p>
          Lorem ipsum dolor sit amet, consectetur adipiscing elit. Nulla eget tortor vel arcu finibus
          scelerisque at vel elit. Vivamus vulputate augue eget nisl ultrices posuere.
        </p>
        {/* Add more content here if needed */}
      </div>

      {/* Form on the right side for large devices */}
      <div className="contact__form">
        <form>
          <h3>Get in Touch</h3>
          <label htmlFor="name">Name:</label>
          <input type="text" id="name" name="name" required />

          <label htmlFor="email">Email:</label>
          <input type="email" id="email" name="email" required />

          <label htmlFor="message">Message:</label>
          <textarea id="message" name="message" required></textarea>

          <button type="submit">Submit</button>
        </form>
      </div>
    </div>
  );
};

export default ContactUs;
